import React from "react";
import { createRoot } from "react-dom/client";
import "./index.css";
import "mdb-react-ui-kit/dist/css/mdb.min.css";
import App from "./Components/App";
import reportWebVitals from "./reportWebVitals";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import { MDBBtn, MDBContainer, MDBRow } from "mdb-react-ui-kit";
import { Link } from "react-router-dom";
import Header from "../Layouts/Header";
import Footer from "../Layouts/Footer";

//import Basic from "./Basic/Basic";
//import Blog from "./Blog/Blog";
//import Aggregator from "./Aggregator/Aggregator";
//import NewsFeed from "./NewsFeed/NewsFeed";
//import Social1 from "./Social1/Social1";
//import Social2 from "./Social2/Social2";
const container = document.getElementById("root");
const root = createRoot(container);

root.render(

  <MDBContainer className="d-flex justify-content-center">
      <MDBRow className="d-block justify-self-top">
        <Header />
      </MDBRow>
      <MDBRow className="d-block justify-self-center">
        <App />
      </MDBRow>
      <MDBRow className="d-block justify-self-bottom">
        <Footer />
      </MDBRow>
    </MDBContainer>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
